import 'bootstrap/dist/css/bootstrap.min.css';
import React from 'react';
import Form_SplineInterpolation from '../Components_Inter/Form_SplineInterpolation';
import Navbar from '../pages/Navbar';

export default function SplineInterpolation() {
    return (
        <div>
            <Navbar />
            <div className='container'>
                <center><h1>Cubic Spline Interpolation</h1></center>
                <Form_SplineInterpolation />
            </div>
        </div>
    );
}
